import React from "react"

const Myposts = (props) => {
return(
    <div>
            {props.statepost.map(item => 
            
                <div key={item.id}>
                    <p>saxeli {item.name}</p>
                    <p>gvari: {item.surname}</p>
                    <img src={item.src}></img>
                    
                </div>
            
            )}
        </div>
    )
}

export default Myposts
